package labuladong.q4;

import java.util.ArrayList;
import java.util.HashMap;
import java.util.List;
import java.util.Map;

/**
 * @author iterators
 * @since 2021/08/28
 */
public class Solution {

    public static void main(String[] args) {
        String s = "";

        String p = "";

        List<Integer> list = findAnagrams(s, p);
        System.out.println("list = " + list);
    }

    public static List<Integer> findAnagrams(String s, String p) {
        // 异位词，使用map记录每个字符出现的次数
        Map<Character, Integer> pMap = new HashMap<>();
        for(int i = 0; i < p.length(); i++){
            pMap.put(p.charAt(i), pMap.getOrDefault(p.charAt(i), 0) + 1);
        }

        // 滑动窗口
        List<Integer> res = new ArrayList();
        Map<Character, Integer> windowMap = new HashMap<>();
        int left = 0;
        int right = 0;
        int valid = 0;
        while (right < s.length()) {
            char ch = s.charAt(right);
            right++;
            if (pMap.containsKey(ch)){
                //  增加窗口中当前元素的个数
                windowMap.put(ch, windowMap.getOrDefault(ch, 0) + 1);
                if (windowMap.get(ch).equals(pMap.get(ch))){
                    valid ++;
                }
            }

            while (valid == pMap.size()) {
                //  寻找当前窗口左侧的left开始元素
                if (right - left >= p.length()){
                    res.add(left);
                }
                char leftCh = s.charAt(left);
                left++;
                if (pMap.containsKey(leftCh)){
                    // 将要移除的左边字符是p中的
                    if (windowMap.get(leftCh).equals(pMap.get(leftCh))){
                        valid--;
                    }
                    windowMap.put(leftCh, windowMap.getOrDefault(leftCh, 0) - 1);
                }
            }
        }
        return res;
    }
}
